  const [password, setPassword] = useState("");

  return (
    <form>
      <DefaultInput
        value={emailOrNumber}
        onChange={setEmailOrNumber}
        classOfContainer="smaller-margin-bottom"
        placeholder="Mobile Number or Email"
      />
    </form>
  )
}


